import styled from "styled-components"

export const ContainerHeader = styled.div`
position: fixed;
z-index: 999;
top: 0;
left: 0;
right: 0;
height: 70px;
    

    background: transparent;
    transition: all ease 0.5s;
    background-color: black;


img {

    width: 100px;
}

`
